class UUID extends React.Component {
  constructor(props) {
    super(props);

    this.new = this.new.bind(this)
  }

  new() {
    return (
      <div>
        <code>{reactUuid()}</code>
      </div>
    )
    console.log("Generating new UUID...")
  }

  render() {
    return (
      <div>
        <button onClick={this.new}>Refresh</button>
      </div>
    );
  }

}

class UUIDGen extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: []
    };
  }

  componentDidMount() {
    fetch("https://api.example.com/items")
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            items: result.items
          });
        },
        // Note: it's important to handle errors here
        // instead of a catch() block so that we don't swallow
        // exceptions from actual bugs in components.
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {
    const { error, isLoaded, items } = this.state;
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <ul>
          {items.map(item => (
            <li key={item.id}>
              {item.name} {item.price}
            </li>
          ))}
        </ul>
      );
    }
  }
}
export default UUIDGen;
